	(964, '_transient_f3e07d8a5567b52eda97b45478a42948', 'O:8:"stdClass":18:{s:11:"new_version";s:5:"1.8.8";s:14:"stable_version";s:5:"1.8.8";s:4:"name";s:13:"WP All Export";s:4:"slug";s:17:"wp-all-export-pro";s:3:"url";s:68:"https://www.wpallimport.com/downloads/wp-all-export-pro/?changelog=1";s:12:"last_updated";s:19:"2024-06-10 19:18:00";s:8:"homepage";s:56:"https://www.wpallimport.com/downloads/wp-all-export-pro/";s:8:"sections";a:2:{s:11:"description";s:164:"<p>Learn more about WP All Export at <a href="http://www.wpallimport.com/export" target="_blank" rel="noopener noreferrer">http://www.wpallimport.com/export</a></p>";s:9:"changelog";s:36775:"<h4>1.8.8</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.4</li>\r\n<li>bug fix: restore compatibility with PHP 7.4</li>\r\n<li>bug fix: Gravity Forms add-on exporting HTML encoded values</li>\r\n</ul><h4>1.8.7</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.4</li>\r\n<li>API: first version of new add-on API</li>\r\n<li>bug fix: GMC height and width fields incorrectly calculated in some cases</li>\r\n<li>bug fix: client mode options do not appear in some cases</li>\r\n<li>bug fix: ‘count’ fatal error in WP_Comment_Query exports</li>\r\n<li>bug fix: WooCommerce Product post meta not correctly retrieved with HPOS active</li>\r\n<li>improvement: better GMC Next support</li>\r\n<li>improvement: increase accuracy of Scheduling service connection checks</li>\r\n</ul><h4>1.8.6</h4>\r\nMinimum WordPress version: 5.0\r\nMinimum PHP version: 7.4\r\n<ul>\r\n<li>security improvement</li>\r\n<li>API: add new filter \'wp_all_export_functions_file_path\' to change the Function Editor\'s file location</li>\r\n<li>API: add new filter \'wp_all_export_product_variation_where\' to override the WP_Query \'where\' for variations</li>\r\n<li>API: add new filter \'wp_all_export_meta_query_limit\' to control how many custom fields can be shown</li>\r\n<li>bug fix: resolve PHP notices for ajax requests</li>\r\n<li>bug fix: fatal error on pre-HPOS WooCommerce versions</li>\r\n<li>bug fix: fatal error in some cases when exporting to XML or GMC</li>\r\n<li>bug fix: fatal error when retrieving file if export doesn\'t exist</li>\r\n<li>bug fix: PHP 8.2 errors</li>\r\n<li>improvement: better handling of brackets in exported data when using custom export fields</li><h4>1.8.5</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.2</li>\r\n<li>note: WooCommerce Export Add-On 1.0.8+ is required to export orders</li>\r\n<li>improvement: better PHP 8.2 support</li>\r\n<li>improvement: add support for filtering by parent slug</li>\r\n<li>improvement: enable adding BOM to files by default for new exports and improve description</li>\r\n<li>improvement: minimize code called during AJAX requests</li>\r\n<li>improvement: remove \'wp_navigation\' from dropdown on Step 1</li>\r\n<li>improvement: gracefully handle cron URL calls to nonexistent exports</li>\r\n<li>improvement: add \'cancel\' action for cron URLs</li>\r\n<li>improvement: only add code to \'admin_head\' when on WP All Export pages</li>\r\n<li>bug fix: resolve miscellaneous PHP notices</li>\r\n<li>bug fix: setting \'Display each product in its own row\' not saved in some cases</li>\r\n<li>bug fix: prevent saved WP All Export sessions from being corrupted by some database configurations</li>\r\n</ul><h4>1.8.4</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.2</li>\r\n<li> improvement: prevent caching of file URLs used with Zapier</li>\r\n<li> adjustment: uncheck \'Display each product in its own row ?\' by default when using \'Migrate\' option for WooCommerce Orders</li>\r\n<li> bug fix: corrected XML layout when using real time order exports</li>\r\n<li> bug fix: corrected exporting of comment IDs to XLS</li>\r\n<li> bug fix: ensure the correct Unique Identifier is set when using the \'Import with WP All Import\' option</li>\r\n</ul><h4>1.8.3</h4><ul>\r\n<li>bug fix: resolve \'enable_real_time_exports\' notice</li>\r\n<li>bug fix: fatal error when post types are defined using closures</li>\r\n</ul><h4>1.8.2</h4><ul>\r\n<li>improvement: individual record data is now available in Zapier when using real time exports (requires 2.0.1+ Zapier trigger version)</li>\r\n<li>improvement: allow exporting \'0\' value in ACF fields</li>\r\n<li>improvement: better \'s\' parameter support for WP_Query exports</li>\r\n<li>improvement: clean up PHP 8 related notices</li>\r\n<li>improvement: better support for symlinked /upload folders</li>\r\n<li>improvement: remove deprecated jQuery functions</li>\r\n<li>improvement: enhanced real time exporting support for RealHomes theme properties</li>\r\n<li>bug fix: don\'t change the \'Product\' label used in the ShopCommerce theme\'s breadcrumbs</li>\r\n<li>bug fix: resolve PHP notices related to Google Merchant Center exports</li>\r\n<li>bug fix: prevent custom XML editor from being shown when exporting to CSV in rare circumstances</li>\r\n<li>bug fix: correct Gravity Forms exported record counts</li>\r\n<li>bug fix: delete missing now works properly with imports created with the \'Import with WP All Import\' option</li>\r\n</ul><h4>1.8.1</h4><ul>\r\n<li>new feature: real time exports - <a href="https://www.wpallimport.com/documentation/how-to-run-real-time-exports/" target="_blank">https://www.wpallimport.com/documentation/how-to-run-real-time-exports/</a> </li>\r\n<li>improvement: set headers to prevent cron URLs and export bundle from being cached</li>\r\n<li>bug fix: enable use of \'s\', \'LIKE\' and \'NOT LIKE\' in WP_Query exports</li>\r\n</ul><h4>1.8.0 </h4><ul><li>bug fix: revert filtering improvements</li></ul>\r\n<h4>1.7.9</h4><ul>\r\n<li>security improvement</li>\r\n<li>bug fix: JavaScript error when the user has the \'Disable syntax highlighting when editing code\' option enabled</li>\r\n<li>bug fix: only one export field can use the \'Export the value returned by a PHP function\' option at a time</li>\r\n<li>improvement: restore compatibility for WordPress 5.0+</li>\r\n<li>improvement: better filtering performance</li>\r\n<li>improvement: better \'custom export field\' performance</li>\r\n</ul><h4>1.7.8</h4><ul><li>bug fix: cannot export products in a single language when using WPML</li></ul>\r\n</ul><h4>1.7.7</h4><ul>\r\n<li>new feature: add option to disable generation of empty export files if no records are matched for export when running via automation</li>\r\n<li>bug fix: allow exporting empty value with custom export field</li>\r\n<li>bug fix: encoded ampersand showing in \'Confirm & Run\' text</li>\r\n<li>bug fix: delimiters are sometimes removed when a field with multiple values is used in a custom export field</li>\r\n<li>bug fix: prevent caching of GMC export files</li>\r\n<li>bug fix: properly format multiple values provided via \'Custom data\' for Product Type in a GMC export</li>\r\n<li>improvement: resolve miscellaneous PHP notices</li>\r\n<li>improvement: only check Scheduling Service connectivity if a Scheduling license has been saved</li>\r\n<li>improvement: UI enhancements</li>\r\n<li>improvement: use CodeMirror library from WordPress Core</li>\r\n</ul><h4>1.7.6</h4><ul>\r\n<li>improvement: add support for Country, Region, and Service shipping sub-attributes for GMC exports</li>\r\n<li>bug fix: can\'t save code to Function Editor</li>\r\n<li>bug fix: error when product dimensions are empty in GMC exports</li>\r\n</ul><h4>1.7.5</h4><ul>\r\n<li>improvement: UI updates</li>\r\n</ul><h4>1.7.4</h4>- bug fix: jQuery nestedSortable compatibility with WordPress 5.9\r\n- improvement: PHP 8 compatibility<h4>1.7.3</h4><ul>\r\n<li>New Feature: compatibility with the Gravity Forms Export Add-On</li>\r\n<li>improvement: fallback to PclZip if ZipArchive isn\'t available</li>\r\n<li>improvement: add support for Cyrillic and Greek characters in element names</li>\r\n<li>bugfix: some output not correctly escaped</li>\r\n<li>bugfix: in some cases, export files are cached when downloaded via a direct link</li>\r\n<li>bugfix: error when exporting attributes</li>\r\n<li>bugfix: notice  when saving client mode settings</li>\r\n<li>bugfix: error on PHP 8 when exports are corrupt</li>\r\n<li>bugfix: error when exporting custom field in simple XML</li>\r\n</ul><h4>1.7.2</h4><ul>\r\n<li>improvement: add support for exporting non-WooCommerce \'product\' CPTs</li>\r\n<li>improvement: initial PHP 8 support</li>\r\n<li>bug fix: fatal error when running \'post\' WP_Query export</li>\r\n<li>bug fix: unexpected newline added to manual custom XML exports</li>\r\n<li>bug fix: CPT exports failing when WooCommerce Export Add-On not active</li>\r\n<li>bug fix: Google Merchant Center shipping dimension unit conversions were incorrect in some cases</li>\r\n<li>bug fix</li>\r\n</ul><h4>1.7.1</h4>\r\n<ul>\r\n 	<li>improvement: decrease the frequency of plugin update checks</li>\r\n 	<li>improvement: add HKG Dollar to Google Merchant Center exports</li>\r\n 	<li>bugfix: error when filtering by WPML language</li>\r\n 	<li>bugfix: WPML language filter not applied when running scheduled exports</li>\r\n 	<li>bugfix: closing tag missing when custom XML export files are empty</li>\r\n</ul>\r\n<h4>1.7.0</h4>\r\n<ul>\r\n 	<li>improvement: added RON to Google Merchant Center export currencies</li>\r\n 	<li>improvement: moved ACF and WooCommerce support to add-ons</li>\r\n</ul>\r\n<h4>1.6.7</h4>\r\n<ul>\r\n 	<li>bugfix: XML tag appended to empty CSV files</li>\r\n 	<li>bugfix: ACF user email field not exported correctly</li>\r\n 	<li>bugfix: PHP notice when adjusting prices in Google Merchant Center exports</li>\r\n</ul>\r\n<h4>1.6.6</h4>\r\n<ul>\r\n 	<li>maintenance: compatibility with Elementor v3.3 JavaScript changes</li>\r\n</ul>\r\n<h4>1.6.5</h4>\r\n<ul>\r\n 	<li>improvement: hide _oembed_ fields from custom fields</li>\r\n 	<li>improvement: update scheduling keys in the scheduling service when changed in settings</li>\r\n 	<li>bugfix: filtering by a custom field called featured working only for products</li>\r\n 	<li>bugfix: functions with empty string arguments not parsed correctly in Custom XML exports</li>\r\n 	<li>bugfix: ratings and star count not exported in WooCommerce Review exports</li>\r\n 	<li>bugfix: simple XML exports generate invalid XML when there are no records by missing the closing tag</li>\r\n 	<li>bugfix: values that contain square brackets not exported in Google Merchants Exports</li>\r\n 	<li>bugfix: custom functions not correctly parsed in Google Merchants Exports</li>\r\n 	<li>bugfix: ACF repeater fields are exported using commas as a delimiter, but the bundle defaults to pipes when importing</li>\r\n</ul>\r\n<h4>1.6.4</h4>\r\n<ul>\r\n 	<li>improvement - remove Friendly Name editing option from Client Mode</li>\r\n 	<li>bugfix - array_intersect_key error when PMXE_Options are corrupt</li>\r\n 	<li>bugfix - order item fields with HTML encoded names can\'t be exported</li>\r\n</ul>\r\n<h4>1.6.3</h4>\r\n<ul>\r\n 	<li>New Feature: Allow non-admins to run exports with Client Mode</li>\r\n 	<li>bug fix: incorrect number of processed entries when exporting items only once in multiple iterations</li>\r\n 	<li>bug fix: Google Merchant Center throws error on shipping length</li>\r\n 	<li>bug fix: state not saved for \'Fill in empty columns\' and \'Display each repeater row in its own csv line\' in ACF repeater fields</li>\r\n 	<li>bug fix: js error when removing filters</li>\r\n 	<li>bug fix: use wp_salt() when AUTH_SALT isn\'t defined</li>\r\n 	<li>bug fix: downloadable files aren\'t migrated properly in some cases</li>\r\n 	<li>bug fix: \'0\' is present in the \'Export the value returned by a PHP function\' setting for Attachment fields</li>\r\n 	<li>bug fix: import template in bundle file not set to choose \'WooCommerce Reviews\' when imported</li>\r\n 	<li>bug fix: featured and attached images options not working for image fields</li>\r\n</ul>\r\n<h4>1.6.2</h4>\r\n<ul>\r\n 	<li>bugfix: some checkbox options broken after WordPress v5.5 compatibility fix</li>\r\n</ul>\r\n<h4>1.6.1</h4>\r\n<ul>\r\n 	<li>maintenance: compatibility with WordPress v5.5 jQuery changes</li>\r\n</ul>\r\n<h4>1.6.0</h4>\r\n<ul>\r\n 	<li>improvement: Export WooCommerce Reviews</li>\r\n 	<li>improvement: Migrate Comments and WooCommerce Reviews</li>\r\n 	<li>improvement: Export Cost of Goods Sold to Google Merchant Center</li>\r\n 	<li>improvement: Add WP_Query support for Toolset Types exports</li>\r\n 	<li>bug fix: time not exported in fields with date and time</li>\r\n 	<li>bug fix: date filters with ‘equal or older than’ doesn\'t include dates equal to the filter value</li>\r\n 	<li>bug fix: no default value for "Set to false if product has no GTIN or MPN"</li>\r\n 	<li>bug fix: PHP 7.3 warnings when exporting Excel files</li>\r\n</ul>\r\n<h4>1.5.11</h4>\r\n<ul>\r\n 	<li>improvement: export custom ACF fields defined in Gutenberg blocks</li>\r\n 	<li>improvement: disable scheduled exports via Automatic Scheduling UI</li>\r\n 	<li>API: add new filter wp_all_export_no_cache to avoid server cache for export files</li>\r\n 	<li>bug fix: WPAE UI is translated to the filtered WPML language</li>\r\n 	<li>bug fix: custom functions unavailable when editing an exported field</li>\r\n 	<li>bug fix: unable to update filters on the Run Export page</li>\r\n 	<li>bug fix: date filters including first/last day of month do not work properly</li>\r\n 	<li>bug fix: notices related to Google Merchants exports</li>\r\n 	<li>bug fix: exports sent to Zapier in the incorrect order</li>\r\n 	<li>bug fix: WooCommerce customer exports do not correctly report the number of exported customers</li>\r\n 	<li>bug fix: unable to only export customers once via scheduled exports</li>\r\n 	<li>bug fix: fields containing commas incorrectly exported to Google Merchant Center</li>\r\n 	<li>bug fix: product names are incorrectly urlencoded in custom XML exports</li>\r\n 	<li>bug fix: taxonomy meta fields not available for export</li>\r\n 	<li>bug fix: 0 values are represented as an empty string in custom XML exports</li>\r\n 	<li>bug fix: order items doubled in custom export fields in custom XML exports</li>\r\n 	<li>bug fix: custom fields not parsed correctly in custom XML exports</li>\r\n 	<li>bug fix: Manual Scheduling disabled when Automatic Scheduling is selected</li>\r\n 	<li>bug fix: unable to filtering by hours or minutes in some cases</li>\r\n 	<li>bug fix: unable to export ACF group fields</li>\r\n 	<li>bug fix: trying to delete History File fails ungracefully if it doesn\'t exist</li>\r\n 	<li>bug fix: Fee Amount exporting as an empty field in custom XML exports</li>\r\n</ul>\r\n<h4>1.5.10</h4>\r\n<ul>\r\n 	<li>improvement: add SAR currency to Google Merchant Center</li>\r\n 	<li>improvement: add default Unit Pricing Measure to Google Merchant Center</li>\r\n 	<li>improvement: only update max_execution_time on plugin requests, don\'t modify it globally</li>\r\n 	<li>bugfix: unable to export WooCommerce customers to XML</li>\r\n 	<li>bugfix: error with empty strings at the beginning or end of function calls</li>\r\n 	<li>bugfix: ACF date field not parsed correctly with some custom date formats</li>\r\n 	<li>bugfix: unable to export image galleries inside ACF flexible content fields to XML</li>\r\n 	<li>bugfix: time-based export filters should use GMT not server time</li>\r\n</ul>\r\n<h4>1.5.9</h4>\r\n<ul>\r\n 	<li>bug fix: unable to export users</li>\r\n</ul>\r\n<h4>1.5.8</h4>\r\n<ul>\r\n 	<li>improvement: add UAH currency to Google Merchant Center exports</li>\r\n 	<li>API: add \'pmxe_is_bundle\' filter</li>\r\n 	<li>bug fix: unable to filter by user data</li>\r\n 	<li>bug fix: wp_query missing error in some cases</li>\r\n 	<li>bug fix: ACF link export incorrectly formatted</li>\r\n 	<li>bug fix: "Tax Amount" rounded to nearest integer</li>\r\n 	<li>bug fix: currency included in price field when price is empty for Google Merchant Center exports</li>\r\n</ul>\r\n<h4>1.5.7</h4>\r\n<ul>\r\n 	<li>improvement: add Thai Baht to Google Merchant Center currencies</li>\r\n 	<li>improvement: add custom line endings for CSV</li>\r\n 	<li>API: add new action pmxe_acf_date_picker_format to set custom ACF date formats</li>\r\n 	<li>bugfix: unable to use wp-cron for scheduled exports on sites running PHP-FPM and WordPress 5.1+</li>\r\n 	<li>switched to wp-load for cron URLs, with backwards compatibility for wp-cron</li>\r\n 	<li>bugfix: ACF repeaters export incorrect values in ACF version 5.7.10+</li>\r\n 	<li>bugfix: Google Merchant Center incorrectly converts units from inches to mm</li>\r\n 	<li>bugfix: ACF date format not parsed correctly</li>\r\n 	<li>bugfix: tax amount incorrectly calculated in PHP 7.1+</li>\r\n 	<li>bugfix: is_empty field only looks for NULL fields, not empty values</li>\r\n 	<li>bugfix: exporting ACF user fields results in error</li>\r\n</ul>\r\n<h4>1.5.6</h4>\r\n<ul>\r\n 	<li>add-on: move all user export functionality to new user export add-on</li>\r\n 	<li>improvement: preserve admin body classes that are added by other plugins</li>\r\n 	<li>improvement: change scheduling endpoints from wp-cron.php to wp-load.php for WordPress 5.1/PHP-FPM compatibility</li>\r\n 	<li>bugfix: change language code alias for WPML compatibility</li>\r\n 	<li>bugfix: meta keys that are not returned as an array are exported as empty</li>\r\n 	<li>bugfix: allow uppercase ID in custom XML template</li>\r\n 	<li>bugfix: use ACF date format for date pickers</li>\r\n 	<li>bugfix: custom export field notices not working for WooCommerce orders</li>\r\n 	<li>bugfix: missing items in combine multiple fields are not replaced</li>\r\n 	<li>bugfix: term ID missing when using custom fields and exporting taxonomies</li>\r\n 	<li>bugfix: some WooCommerce attributes cause errors when writing to CSV</li>\r\n 	<li>bugfix: scheduling API responses improperly translated</li>\r\n 	<li>bugfix: changes to field not rendered in preview from edit field modal</li>\r\n</ul>\r\n<h4>1.5.5</h4>\r\n<ul>\r\n 	<li>bug fix: compatibility with ACF v5.7.11</li>\r\n</ul>\r\n<h4>1.5.4</h4>\r\n<ul>\r\n 	<li>improvement: add RTL support for Excel</li>\r\n 	<li>improvement: add Indonesian Rupiah to Google Merchant Center</li>\r\n 	<li>improvement: add Google Merchant Center field name as global variable to be used in custom functions</li>\r\n 	<li>bugfix: improve support for quotes in custom xml</li>\r\n 	<li>bugfix: increase number of rendered categories for Google Merchant Center</li>\r\n 	<li>bugfix: Google Merchant Center dimensions</li>\r\n 	<li>bugfix: include variations when filtering by categories</li>\r\n 	<li>bugfix: combine error messages when exporting refunds</li>\r\n 	<li>bugfix: refund ID snippet not being replaced when field is missing</li>\r\n 	<li>bugfix: fix filtering error when exporting comments</li>\r\n 	<li>bugfix: support exports scheduled at 12am and 12pm</li>\r\n 	<li>bugfix: fix filtering products with titles that contain slashes</li>\r\n 	<li>bugfix: merge headers for empty columns at end of file</li>\r\n 	<li>bugfix: fix filtering UI for long titles</li>\r\n 	<li>bugfix: allow exporting ACF checkbox fields</li>\r\n 	<li>bugfix: pmxe_woo_field parameters incorrect</li>\r\n 	<li>bugfix: downloadable files in custom XML not exporting</li>\r\n 	<li>bugfix: close incorrect tags when exporting ACF</li>\r\n 	<li>bugfix: export serialized values in combined fields</li>\r\n 	<li>bugfix: custom functions in Google Merchant Center price elements not triggering</li>\r\n 	<li>bugfix: get_site_url in multisite when using Google Merchant Center</li>\r\n 	<li>bugfix: allow users to be filtered by name</li>\r\n 	<li>bugfix: fix custom export fields in simple XML exports</li>\r\n 	<li>bugfix: fix tax rate code exports in custom export fields</li>\r\n</ul>\r\n<h4>1.5.3</h4>\r\n<ul>\r\n 	<li>improvement: improve function parsing in custom export fields</li>\r\n 	<li>improvement: Google Merchant Center titles are limited to 150 characters</li>\r\n 	<li>improvement: increase custom query meta limit</li>\r\n 	<li>new filter: added pmxe_after_iteration action</li>\r\n 	<li>bugfix: remove deprecated function calls for PHP 7.2 compatibility</li>\r\n 	<li>bugfix: address various PHP warnings and notices</li>\r\n 	<li>bugfix: filters for WooCommerce product variations</li>\r\n 	<li>bugfix: graceful failure for non:writable uploads folder</li>\r\n 	<li>bugfix: add warning when exporting WooCommerce orders using Automatic Scheduling</li>\r\n 	<li>bugfix: WooCommerce product variations exported as separate products when adding product attributes to custom export fields</li>\r\n 	<li>bugfix: function editor not rendered until clicked</li>\r\n 	<li>bugfix: small UI and spacing issues</li>\r\n 	<li>bugfix: WooCommerce products don\'t on their own row in order exports when using custom export fields</li>\r\n 	<li>bugfix: prices with more than two decimal places are not exported correctly</li>\r\n 	<li>bugfix: \'Only export orders that have been modified since last export\' doesn\'t work when filtering orders</li>\r\n 	<li>bugfix: exporting empty ACF values shifts rows in CSV exports</li>\r\n 	<li>bugfix: Australia missing from scheduling timezones</li>\r\n 	<li>bugfix: exporting meta in WooCommerce orders</li>\r\n 	<li>bugfix: unable to filter or export WooCommerce product visibility data</li>\r\n 	<li>bugfix: cannot export product type for variable products to Google Merchant Center</li>\r\n 	<li>bugfix: Google Merchant Center exports cannot automatically map sub-categories</li>\r\n</ul>\r\n<h4>1.5.2</h4>\r\n<ul>\r\n 	<li>improvement: Support migrating users &amp; keeping passwords</li>\r\n 	<li>improvement: Add Featured Image to Available Data › Media</li>\r\n 	<li>new filter: wp_all_export_raw_prices - disables price formatting</li>\r\n 	<li>bugfix: Error thrown when uploads folder is not writable</li>\r\n 	<li>bugfix: Preview is broken for date fields</li>\r\n 	<li>bugfix: Product visibility broken for old WooCommerce versions</li>\r\n 	<li>bugfix: Custom Export Field values not saved in some cases</li>\r\n 	<li>bugfix: Headers not matching content when they contain special characters</li>\r\n 	<li>bugfix: Headers not matching content when exporting certain ACF fields</li>\r\n 	<li>bugfix: Loading order for styles optimized to reduce conflicts</li>\r\n 	<li>bugfix: Import templates broken for WooCommerce product attributes</li>\r\n 	<li>bugfix: \'Export Images from Post Content\' option doesn\'t displaying in some cases</li>\r\n 	<li>bugfix: JSON parameters can now be passed through functions in Google Merchant Center exports</li>\r\n 	<li>bugfix: WP Query exports broken for users and comments</li>\r\n 	<li>bugfix: Meta missing when migrating unattached images</li>\r\n 	<li>bugfix: Available Data broken when there\'s more than 500 data elements</li>\r\n 	<li>bugfix: Custom Export Fields are unstable when many are added to the same export</li>\r\n</ul>\r\n<h4>1.5.1</h4>\r\n<ul>\r\n 	<li>bug fix: custom fields are exported as their name</li>\r\n</ul>\r\n<h4>1.5.0</h4>\r\n<ul>\r\n 	<li>new feature: Automatic Scheduling</li>\r\n 	<li>new feature: Custom export fields</li>\r\n 	<li>improvement: licenses hidden in the ui and encoded in the database</li>\r\n 	<li>improvement: improved error reporting for custom functions errors</li>\r\n 	<li>improvement: changed excerpt to short description</li>\r\n 	<li>improvement: better price formatting</li>\r\n 	<li>improvement: better function parsing in Google Merchant Center exports</li>\r\n 	<li>improvement: exclude parent products from Google Merchant Center exports</li>\r\n 	<li>improvement: added CHF to list of supported Google Merchant Center currencies</li>\r\n 	<li>improvement: added support for acf clone field</li>\r\n 	<li>improvement: added security token to cron URLs for improved security</li>\r\n 	<li>improvement: added author information to Available Data</li>\r\n 	<li>improvement: added wp_all_export_order_item filter</li>\r\n 	<li>improvement: added wp_all_export_use_csv_compliant_line_endings filter</li>\r\n 	<li>improvement: added wp_all_export_pre_csv_headers filter</li>\r\n 	<li>improvement: added wp_all_export_repeater_delimiter filter</li>\r\n 	<li>bugfix: PHP notices and warnings</li>\r\n 	<li>bugfix: error when activating Pro version and Free version</li>\r\n 	<li>bugfix: splitting custom XML export files</li>\r\n 	<li>bugfix: removed moment.js which was causing false virus positives in some browsers</li>\r\n 	<li>bugfix: Google Merchant Center category mapping</li>\r\n 	<li>bugfix: do not update comment status by default</li>\r\n 	<li>bugfix: "only export modified posts" when using cron</li>\r\n 	<li>bugfix: file name filters when using crons</li>\r\n 	<li>bugfix: shortcodes in custom XML snippets</li>\r\n 	<li>bugfix: ACF flexible fields</li>\r\n 	<li>bugfix: problems when running Google Merchant Center exports via cron</li>\r\n 	<li>bugfix: CSV writer fixes to take into account https://bugs.php.net/bug.php?id=43225</li>\r\n 	<li>bugfix: exporting ACF and custom fields with HTML tags</li>\r\n 	<li>bugfix: stray root tags in WooCommerce Order exports</li>\r\n 	<li>bugfix: timeouts when connecting Jetpack to WordPress.com</li>\r\n 	<li>bugfix: exporting product images in Google Merchant Center</li>\r\n 	<li>bugfix: corrupted Excel files</li>\r\n 	<li>bugfix: conflicts with some plugins changing the post order</li>\r\n 	<li>bugfix: comment handling in custom XML</li>\r\n 	<li>bugfix: blank CodeMirror in dialogs</li>\r\n 	<li>bugfix: parsing CDATA tags that contain HTML tags</li>\r\n 	<li>bugfix: Google Merchant Center handling quotes in functions</li>\r\n 	<li>bugfix: improved Google Merchant Center snippet parser</li>\r\n 	<li>bugfix: CSV headers when field names contained quotes</li>\r\n 	<li>bugfix: included WPML query in variation query</li>\r\n 	<li>bugfix: handling of the "visibility" field based on WooCommerce version</li>\r\n</ul>\r\n<h4>1.4.7</h4>\r\n<ul>\r\n 	<li>improvement: Improved accuracy for export timer</li>\r\n 	<li>improvement: Removed moment.js dependency which causes false positives in some antivirus software</li>\r\n 	<li>imporovement New export complete page</li>\r\n 	<li>bugfix: Fixed problems when switching from WPAE free to WPAE pro</li>\r\n 	<li>bugfix: Special characters in product attributes support</li>\r\n 	<li>bugfix: Fix category mapper containing special characters</li>\r\n 	<li>bugfix: Fixed parsing content with shortcodes in custom XML Export</li>\r\n 	<li>bugfix: Fixed exporting ACF fields with no value for some posts</li>\r\n</ul>\r\n<h4>1.4.6</h4>\r\n<ul>\r\n 	<li>improvement: removed autoload=true from wp_options</li>\r\n 	<li>improvement: use \'Export product variations and their parent products\' by default</li>\r\n 	<li>improvement: WPML options in separate section</li>\r\n 	<li>improvement: category mapper optimization</li>\r\n 	<li>improvement: memory usage to avoid memory limit errors</li>\r\n 	<li>bug fix: allow underscores in main xml tags</li>\r\n 	<li>bug fix: prevent uploading import template into wpae</li>\r\n 	<li>bug fix: ID column in CSV</li>\r\n 	<li>bug fix: date equals or older filter</li>\r\n 	<li>bug fix: ACF repeater headers</li>\r\n 	<li>bug fix: size type mapper and no categories message</li>\r\n 	<li>bug fix: export ID in custom XML mode</li>\r\n 	<li>bug fix: date filtering</li>\r\n 	<li>bug fix: export product variation status</li>\r\n 	<li>bug fix: the "Shipping Class" field in Google Merchants export.</li>\r\n</ul>\r\n<h4>1.4.5</h4>\r\n<ul>\r\n 	<li>improvement: added new option \'Only export Pages that have been modified since last export\'</li>\r\n 	<li>improvement: added post_modified field</li>\r\n 	<li>improvement: handling functions in google meerchants fields</li>\r\n 	<li>bug fix: snippets parsing in Custom XML Export</li>\r\n 	<li>bug fix: template saving. Fixed product image export to Google Merchants</li>\r\n 	<li>bug fix: export attributes for simple products</li>\r\n 	<li>bug fix: db schema updating</li>\r\n 	<li>bug fix: variations with trashed parents shouldn\'t be included in the export</li>\r\n 	<li>bug fix: google Merchants inconsistent category search</li>\r\n 	<li>bug fix: minified JS to avoid problems for CloudFlare users</li>\r\n</ul>\r\n<h4>1.4.4</h4>\r\n<ul>\r\n 	<li>improvement: export to Google Merchant Center</li>\r\n 	<li>improvement: choose WPML language in export options</li>\r\n 	<li>improvement: filter WooCommerce Orders by order item data</li>\r\n 	<li>improvement: export CSV without header row</li>\r\n 	<li>bug fix: export ACF message field</li>\r\n 	<li>bug fix: export product categories with AFC repeater fields</li>\r\n 	<li>bug fix: export duplicate images from gallery</li>\r\n 	<li>bug fix: filter products by custom fields</li>\r\n 	<li>bug fix: export search</li>\r\n 	<li>bug fix: export product variation attribute names</li>\r\n 	<li>bug fix: processing serialized data in custom snippets</li>\r\n 	<li>bug fix: export more than one coupon_used field</li>\r\n 	<li>bug fix: migrating hierarchical posts and pages</li>\r\n</ul>\r\n<h4>1.4.3</h4>\r\n<ul>\r\n 	<li>improvement: compatibility with PHP 7.x</li>\r\n 	<li>improvement: new export field \'Order Item ID\'</li>\r\n 	<li>improvement: possibility for filter order by order items data</li>\r\n 	<li>improvement: new option \'Include header row and column titles in export\'</li>\r\n 	<li>bug fix: processing serialized data in custom snippets</li>\r\n 	<li>bug fix: export ACF repeater field in custom XML mode</li>\r\n 	<li>bug fix: applying php function to product attributes</li>\r\n 	<li>bug fix: export coupon_used field</li>\r\n</ul>\r\n<h4>1.4.2</h4>\r\n<ul>\r\n 	<li>new feature: added export taxonomies feature</li>\r\n 	<li>improvement: new export variable products options</li>\r\n 	<li>improvement: added possibility to export to xlsx</li>\r\n 	<li>improvement: added ACF fields to \'migrate\' &amp; \'add all fields\' features</li>\r\n 	<li>improvement: added new filter \'wp_all_export_field_name\'</li>\r\n 	<li>improvement: changed default date export to Y/m/d</li>\r\n 	<li>bug fix: export shipping class for product variations</li>\r\n 	<li>bug fix: import template for ACF relationship fields</li>\r\n 	<li>bug fix: export ACF fields in custom XML mode</li>\r\n 	<li>bug fix: export empty images metadata</li>\r\n 	<li>bug fix: import template for ACF gallery</li>\r\n 	<li>bug fix: import template for variation_description</li>\r\n 	<li>bug fix: import template for default product attributes</li>\r\n 	<li>bug fix: fields ordering for custom XML export</li>\r\n 	<li>bug fix: menu order migration</li>\r\n 	<li>bug fix: automatically adding parent_id column on products export</li>\r\n 	<li>bug fix: SQL query ( caused timeout error )</li>\r\n 	<li>bug fix: parsing snippets in attributes in elements</li>\r\n</ul>\r\n<h4>1.4.1</h4>\r\n<ul>\r\n 	<li>bug fix: compatibility with PHP 5.3</li>\r\n</ul>\r\n<h4>1.4.0</h4>\r\n<ul>\r\n 	<li>new feature: export custom xml template</li>\r\n 	<li>improvement: new filter wp_all_export_after_csv_line</li>\r\n 	<li>improvement: date options for sale price dates from/to</li>\r\n 	<li>improvement: ability to use tab as csv delimiter</li>\r\n 	<li>improvement: new filter \'wp_all_export_csv_headers\'</li>\r\n 	<li>improvement: pull the parent taxonomy data when exporting variations</li>\r\n 	<li>improvement: remove spaces from export filename</li>\r\n 	<li>bug fix: \'posts_clauses\' filter issue</li>\r\n 	<li>bug fix: db schema on multisite</li>\r\n 	<li>bug fix: export order items date</li>\r\n 	<li>bug fix: import template for media items</li>\r\n 	<li>bug fix: \'Only export Products once\' for new exports</li>\r\n 	<li>bug fix: export ACF repeater in XML format</li>\r\n 	<li>bug fix: order_completed_date filter</li>\r\n 	<li>bug fix: export in CSV format when \'Main XML Tag\' &amp; \'Record XML Tag\' option are blank</li>\r\n 	<li>bug fix: export order items taxonomies</li>\r\n 	<li>bug fix: export ACF date_time_picker</li>\r\n 	<li>bug fix: date filter by time</li>\r\n 	<li>bug fix: is empty filters</li>\r\n 	<li>bug fix: nested filter rules</li>\r\n</ul>\r\n<h4>1.3.2</h4>\r\n<ul>\r\n 	<li>fixed \'Only export Posts once\' for new exports</li>\r\n 	<li>fixed db schema for multisite</li>\r\n 	<li>fixed export order items date</li>\r\n 	<li>fixed media items export ordering</li>\r\n 	<li>fixed import template for media items</li>\r\n 	<li>fixed export ACF repeater in XML format</li>\r\n 	<li>fixed order_completed_date filter</li>\r\n 	<li>added new filter \'wp_all_export_csv_headers\'</li>\r\n 	<li>added possibility to use tab as csv delimiter "t"</li>\r\n 	<li>updated french translation</li>\r\n</ul>\r\n<h4>1.3.1</h4>\r\n<ul>\r\n 	<li>added WooCommerce order migration</li>\r\n 	<li>added _thumbnail_id to the filtering dropdown</li>\r\n 	<li>added new filter \'wp_all_export_is_wrap_value_into_cdata\'</li>\r\n 	<li>added new filters \'wp_all_export_add_before_element\', \'wp_all_export_add_after_element\'</li>\r\n 	<li>added \'WPML Translation ID\' element to available data</li>\r\n 	<li>modified preview to show first 10 records</li>\r\n 	<li>fixed csv export with non comma delimiter</li>\r\n 	<li>fixed conflict with WP Google Maps Pro plugin</li>\r\n 	<li>fixed downloading XLS export file when security mode is disabled</li>\r\n</ul>\r\n<h4>1.3.0</h4>\r\n<ul>\r\n 	<li>fixed misaligned columns on exporting product attributes</li>\r\n 	<li>fixed export nested repeaters field in CSV format</li>\r\n 	<li>fixed conflict between enabled ‘Only export Products once’ &amp; filtering rules</li>\r\n 	<li>fixed live records counting for advanced export mode</li>\r\n 	<li>fixed Events Calendar conflict</li>\r\n 	<li>added Google Merchants support</li>\r\n 	<li>added new filters \'wp_all_export_add_before_node\', \'wp_all_export_add_after_node\'</li>\r\n 	<li>added possibility to filter posts by author data</li>\r\n 	<li>added XLS support, redesign CSV/XML options in Step 2</li>\r\n 	<li>added feature to use php function in filtering rules</li>\r\n 	<li>added possibility export repeater rows one per line</li>\r\n 	<li>added backward compatibility for export comments on WordPress less than 4.2.0</li>\r\n 	<li>exclude orphaned variations from exprt file</li>\r\n 	<li>changed UI for export media data ( images &amp; attachments )</li>\r\n</ul>\r\n<h4>1.2.3</h4>\r\n<ul>\r\n 	<li>fixed export attachment meta alt</li>\r\n 	<li>fixed export manually stored ACF</li>\r\n 	<li>fixed export repeater field for users in csv format</li>\r\n 	<li>fixed saving special chars in function editor</li>\r\n 	<li>fixed import export templates</li>\r\n 	<li>fixed error on activate WPAE license</li>\r\n 	<li>fixed ajaxurl conflict with WPML</li>\r\n 	<li>fixed filtering by ACF taxonomy field</li>\r\n 	<li>create a stable copy of exported file for remote access during export process</li>\r\n 	<li>added French &amp; Latvian translations</li>\r\n 	<li>added \'Variation Description\' field</li>\r\n</ul>\r\n<h4>1.2.2</h4>\r\n<ul>\r\n 	<li>fixed \'wp_all_export_additional_data\' filter on cron job</li>\r\n 	<li>fixed Zapier intergation</li>\r\n 	<li>fixed import template for variable products</li>\r\n 	<li>fixed css for WordPress 4.4</li>\r\n 	<li>fixed export ACF repeater field</li>\r\n</ul>\r\n<h4>1.2.1</h4>\r\n<ul>\r\n 	<li>added export comments</li>\r\n 	<li>added possibility to add NS to field names</li>\r\n 	<li>fixed export repeater field ACF 4.x</li>\r\n 	<li>fixed cron export, was exported wrong data amount when there are sticky posts in database</li>\r\n 	<li>fixed updating filter rules on cron job</li>\r\n 	<li>fixed error on edit custom column name for Woo Orders</li>\r\n</ul>\r\n<h4>1.2.0</h4>\r\n<ul>\r\n 	<li>fixed manage exports screen: "Info and options" disappears when WPAI plugin is disabled</li>\r\n 	<li>fixed WP_Query results ordering</li>\r\n 	<li>fixed export ACF repeater field for CSV</li>\r\n 	<li>fixed export filtering</li>\r\n 	<li>added es_ES translation</li>\r\n 	<li>added possibility to change export field name ( related to export WooCommerce Orders )</li>\r\n 	<li>added option \'Split large exports into multiple files\'</li>\r\n 	<li>added option \'Only export posts once\'</li>\r\n 	<li>added option \'Create a new export file each time export is run\'</li>\r\n 	<li>added option \'Fill in empty columns\': If enabled, each order item will appear as its own row with all order info filled in for every column. If disabled, order info will only display on one row with only the order item info displaying in additional rows</li>\r\n 	<li>added ‘pmxe_exported_post’ action: do_action(\'pmxe_exported_post\', $record-&gt;ID );</li>\r\n 	<li>added Zapier support ( beta )</li>\r\n 	<li>added possibility to control main xml tag names &amp; put additional info into xml file: apply_filters(\'wp_all_export_additional_data\', array(), $exportOptions)</li>\r\n 	<li>added export templates</li>\r\n 	<li>added hidden post types to the dropdown list on step 1</li>\r\n 	<li>replaced \'export key\' to \'export hash\' in \'Export File URL\' on scheduling page</li>\r\n 	<li>updated re-run export screen</li>\r\n</ul>\r\n<h4>1.1.1</h4>\r\n<ul>\r\n 	<li>fixed download bundle</li>\r\n 	<li>fixed export repeater fields for ACF 4.x</li>\r\n 	<li>fixed import template for custom product attributes</li>\r\n 	<li>fixed cron job responses, now theay are in JSON format</li>\r\n 	<li>added bundle URL to scheduling page</li>\r\n 	<li>added new option \'include BOM to export file</li>\r\n 	<li>added RU translation</li>\r\n 	<li>added function editor</li>\r\n 	<li>removed hidden post types from dropdown in step 1</li>\r\n</ul>\r\n<h4>1.1.0</h4>\r\n<ul>\r\n 	<li>fixed export taxonomy: name instead of slug</li>\r\n 	<li>fixed export filtering (query with multiple meta keys)</li>\r\n 	<li>fixed display products in own row option</li>\r\n 	<li>fixed pass data through php function</li>\r\n 	<li>added advanced (custom fields) section to export woo orders</li>\r\n 	<li>added draggable element deletion</li>\r\n 	<li>added auto-generate product export fields</li>\r\n 	<li>added \'attributes\' field to product data</li>\r\n 	<li>added feedback page</li>\r\n 	<li>added another \'Auto Generate\' button for products export</li>\r\n 	<li>added button to download bundle for WP All Import</li>\r\n 	<li>updated export file name</li>\r\n 	<li>changed export files destination to /exports</li>\r\n</ul>\r\n<h4>1.0.2</h4>\r\n<ul>\r\n 	<li>Added export users</li>\r\n 	<li>Added scheduled exports</li>\r\n 	<li>Added orders export</li>\r\n 	<li>Added filtering options</li>\r\n</ul>\r\n<h4>1.0.1</h4>\r\n<ul>\r\n 	<li>updated icons</li>\r\n 	<li>fixed taxonomies export</li>\r\n</ul>\r\n<h4>1.0.0</h4>\r\n<ul>\r\n 	<li>Initial release</li>\r\n</ul>";}s:7:"banners";a:2:{s:4:"high";s:56:"https://ps.w.org/wp-all-export/assets/banner-772x250.png";s:3:"low";s:0:"";}s:18:"custom_update_note";s:0:"";s:19:"update_note_version";s:0:"";s:5:"icons";a:0:{}s:3:"msg";s:33:"No license key has been provided.";s:6:"tested";s:5:"6.5.4";s:6:"author";s:6:"Soflyy";s:8:"requires";s:3:"5.0";s:12:"requires_php";s:3:"7.4";s:12:"contributors";a:2:{s:6:"soflyy";a:3:{s:12:"display_name";s:6:"soflyy";s:7:"profile";s:37:"https://profiles.wordpress.org/soflyy";s:6:"avatar";s:51:"https://wordpress.org/grav-redirect.php?user=soflyy";}s:11:"wpallimport";a:3:{s:12:"display_name";s:11:"wpallimport";s:7:"profile";s:42:"https://profiles.wordpress.org/wpallimport";s:6:"avatar";s:56:"https://wordpress.org/grav-redirect.php?user=wpallimport";}}}', 'no'),
	(965, 'wp-all-export-pro_f3e07d8a5567b52eda97b45478a42948', 'O:8:"stdClass":18:{s:11:"new_version";s:5:"1.8.8";s:14:"stable_version";s:5:"1.8.8";s:4:"name";s:13:"WP All Export";s:4:"slug";s:17:"wp-all-export-pro";s:3:"url";s:68:"https://www.wpallimport.com/downloads/wp-all-export-pro/?changelog=1";s:12:"last_updated";s:19:"2024-06-10 19:18:00";s:8:"homepage";s:56:"https://www.wpallimport.com/downloads/wp-all-export-pro/";s:8:"sections";a:2:{s:11:"description";s:164:"<p>Learn more about WP All Export at <a href="http://www.wpallimport.com/export" target="_blank" rel="noopener noreferrer">http://www.wpallimport.com/export</a></p>";s:9:"changelog";s:36775:"<h4>1.8.8</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.4</li>\r\n<li>bug fix: restore compatibility with PHP 7.4</li>\r\n<li>bug fix: Gravity Forms add-on exporting HTML encoded values</li>\r\n</ul><h4>1.8.7</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.4</li>\r\n<li>API: first version of new add-on API</li>\r\n<li>bug fix: GMC height and width fields incorrectly calculated in some cases</li>\r\n<li>bug fix: client mode options do not appear in some cases</li>\r\n<li>bug fix: ‘count’ fatal error in WP_Comment_Query exports</li>\r\n<li>bug fix: WooCommerce Product post meta not correctly retrieved with HPOS active</li>\r\n<li>improvement: better GMC Next support</li>\r\n<li>improvement: increase accuracy of Scheduling service connection checks</li>\r\n</ul><h4>1.8.6</h4>\r\nMinimum WordPress version: 5.0\r\nMinimum PHP version: 7.4\r\n<ul>\r\n<li>security improvement</li>\r\n<li>API: add new filter \'wp_all_export_functions_file_path\' to change the Function Editor\'s file location</li>\r\n<li>API: add new filter \'wp_all_export_product_variation_where\' to override the WP_Query \'where\' for variations</li>\r\n<li>API: add new filter \'wp_all_export_meta_query_limit\' to control how many custom fields can be shown</li>\r\n<li>bug fix: resolve PHP notices for ajax requests</li>\r\n<li>bug fix: fatal error on pre-HPOS WooCommerce versions</li>\r\n<li>bug fix: fatal error in some cases when exporting to XML or GMC</li>\r\n<li>bug fix: fatal error when retrieving file if export doesn\'t exist</li>\r\n<li>bug fix: PHP 8.2 errors</li>\r\n<li>improvement: better handling of brackets in exported data when using custom export fields</li><h4>1.8.5</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.2</li>\r\n<li>note: WooCommerce Export Add-On 1.0.8+ is required to export orders</li>\r\n<li>improvement: better PHP 8.2 support</li>\r\n<li>improvement: add support for filtering by parent slug</li>\r\n<li>improvement: enable adding BOM to files by default for new exports and improve description</li>\r\n<li>improvement: minimize code called during AJAX requests</li>\r\n<li>improvement: remove \'wp_navigation\' from dropdown on Step 1</li>\r\n<li>improvement: gracefully handle cron URL calls to nonexistent exports</li>\r\n<li>improvement: add \'cancel\' action for cron URLs</li>\r\n<li>improvement: only add code to \'admin_head\' when on WP All Export pages</li>\r\n<li>bug fix: resolve miscellaneous PHP notices</li>\r\n<li>bug fix: setting \'Display each product in its own row\' not saved in some cases</li>\r\n<li>bug fix: prevent saved WP All Export sessions from being corrupted by some database configurations</li>\r\n</ul><h4>1.8.4</h4><ul>\r\n<li>minimum WordPress version: 5.0</li>\r\n<li>minimum PHP version: 7.2</li>\r\n<li> improvement: prevent caching of file URLs used with Zapier</li>\r\n<li> adjustment: uncheck \'Display each product in its own row ?\' by default when using \'Migrate\' option for WooCommerce Orders</li>\r\n<li> bug fix: corrected XML layout when using real time order exports</li>\r\n<li> bug fix: corrected exporting of comment IDs to XLS</li>\r\n<li> bug fix: ensure the correct Unique Identifier is set when using the \'Import with WP All Import\' option</li>\r\n</ul><h4>1.8.3</h4><ul>\r\n<li>bug fix: resolve \'enable_real_time_exports\' notice</li>\r\n<li>bug fix: fatal error when post types are defined using closures</li>\r\n</ul><h4>1.8.2</h4><ul>\r\n<li>improvement: individual record data is now available in Zapier when using real time exports (requires 2.0.1+ Zapier trigger version)</li>\r\n<li>improvement: allow exporting \'0\' value in ACF fields</li>\r\n<li>improvement: better \'s\' parameter support for WP_Query exports</li>\r\n<li>improvement: clean up PHP 8 related notices</li>\r\n<li>improvement: better support for symlinked /upload folders</li>\r\n<li>improvement: remove deprecated jQuery functions</li>\r\n<li>improvement: enhanced real time exporting support for RealHomes theme properties</li>\r\n<li>bug fix: don\'t change the \'Product\' label used in the ShopCommerce theme\'s breadcrumbs</li>\r\n<li>bug fix: resolve PHP notices related to Google Merchant Center exports</li>\r\n<li>bug fix: prevent custom XML editor from being shown when exporting to CSV in rare circumstances</li>\r\n<li>bug fix: correct Gravity Forms exported record counts</li>\r\n<li>bug fix: delete missing now works properly with imports created with the \'Import with WP All Import\' option</li>\r\n</ul><h4>1.8.1</h4><ul>\r\n<li>new feature: real time exports - <a href="https://www.wpallimport.com/documentation/how-to-run-real-time-exports/" target="_blank">https://www.wpallimport.com/documentation/how-to-run-real-time-exports/</a> </li>\r\n<li>improvement: set headers to prevent cron URLs and export bundle from being cached</li>\r\n<li>bug fix: enable use of \'s\', \'LIKE\' and \'NOT LIKE\' in WP_Query exports</li>\r\n</ul><h4>1.8.0 </h4><ul><li>bug fix: revert filtering improvements</li></ul>\r\n<h4>1.7.9</h4><ul>\r\n<li>security improvement</li>\r\n<li>bug fix: JavaScript error when the user has the \'Disable syntax highlighting when editing code\' option enabled</li>\r\n<li>bug fix: only one export field can use the \'Export the value returned by a PHP function\' option at a time</li>\r\n<li>improvement: restore compatibility for WordPress 5.0+</li>\r\n<li>improvement: better filtering performance</li>\r\n<li>improvement: better \'custom export field\' performance</li>\r\n</ul><h4>1.7.8</h4><ul><li>bug fix: cannot export products in a single language when using WPML</li></ul>\r\n</ul><h4>1.7.7</h4><ul>\r\n<li>new feature: add option to disable generation of empty export files if no records are matched for export when running via automation</li>\r\n<li>bug fix: allow exporting empty value with custom export field</li>\r\n<li>bug fix: encoded ampersand showing in \'Confirm & Run\' text</li>\r\n<li>bug fix: delimiters are sometimes removed when a field with multiple values is used in a custom export field</li>\r\n<li>bug fix: prevent caching of GMC export files</li>\r\n<li>bug fix: properly format multiple values provided via \'Custom data\' for Product Type in a GMC export</li>\r\n<li>improvement: resolve miscellaneous PHP notices</li>\r\n<li>improvement: only check Scheduling Service connectivity if a Scheduling license has been saved</li>\r\n<li>improvement: UI enhancements</li>\r\n<li>improvement: use CodeMirror library from WordPress Core</li>\r\n</ul><h4>1.7.6</h4><ul>\r\n<li>improvement: add support for Country, Region, and Service shipping sub-attributes for GMC exports</li>\r\n<li>bug fix: can\'t save code to Function Editor</li>\r\n<li>bug fix: error when product dimensions are empty in GMC exports</li>\r\n</ul><h4>1.7.5</h4><ul>\r\n<li>improvement: UI updates</li>\r\n</ul><h4>1.7.4</h4>- bug fix: jQuery nestedSortable compatibility with WordPress 5.9\r\n- improvement: PHP 8 compatibility<h4>1.7.3</h4><ul>\r\n<li>New Feature: compatibility with the Gravity Forms Export Add-On</li>\r\n<li>improvement: fallback to PclZip if ZipArchive isn\'t available</li>\r\n<li>improvement: add support for Cyrillic and Greek characters in element names</li>\r\n<li>bugfix: some output not correctly escaped</li>\r\n<li>bugfix: in some cases, export files are cached when downloaded via a direct link</li>\r\n<li>bugfix: error when exporting attributes</li>\r\n<li>bugfix: notice  when saving client mode settings</li>\r\n<li>bugfix: error on PHP 8 when exports are corrupt</li>\r\n<li>bugfix: error when exporting custom field in simple XML</li>\r\n</ul><h4>1.7.2</h4><ul>\r\n<li>improvement: add support for exporting non-WooCommerce \'product\' CPTs</li>\r\n<li>improvement: initial PHP 8 support</li>\r\n<li>bug fix: fatal error when running \'post\' WP_Query export</li>\r\n<li>bug fix: unexpected newline added to manual custom XML exports</li>\r\n<li>bug fix: CPT exports failing when WooCommerce Export Add-On not active</li>\r\n<li>bug fix: Google Merchant Center shipping dimension unit conversions were incorrect in some cases</li>\r\n<li>bug fix</li>\r\n</ul><h4>1.7.1</h4>\r\n<ul>\r\n 	<li>improvement: decrease the frequency of plugin update checks</li>\r\n 	<li>improvement: add HKG Dollar to Google Merchant Center exports</li>\r\n 	<li>bugfix: error when filtering by WPML language</li>\r\n 	<li>bugfix: WPML language filter not applied when running scheduled exports</li>\r\n 	<li>bugfix: closing tag missing when custom XML export files are empty</li>\r\n</ul>\r\n<h4>1.7.0</h4>\r\n<ul>\r\n 	<li>improvement: added RON to Google Merchant Center export currencies</li>\r\n 	<li>improvement: moved ACF and WooCommerce support to add-ons</li>\r\n</ul>\r\n<h4>1.6.7</h4>\r\n<ul>\r\n 	<li>bugfix: XML tag appended to empty CSV files</li>\r\n 	<li>bugfix: ACF user email field not exported correctly</li>\r\n 	<li>bugfix: PHP notice when adjusting prices in Google Merchant Center exports</li>\r\n</ul>\r\n<h4>1.6.6</h4>\r\n<ul>\r\n 	<li>maintenance: compatibility with Elementor v3.3 JavaScript changes</li>\r\n</ul>\r\n<h4>1.6.5</h4>\r\n<ul>\r\n 	<li>improvement: hide _oembed_ fields from custom fields</li>\r\n 	<li>improvement: update scheduling keys in the scheduling service when changed in settings</li>\r\n 	<li>bugfix: filtering by a custom field called featured working only for products</li>\r\n 	<li>bugfix: functions with empty string arguments not parsed correctly in Custom XML exports</li>\r\n 	<li>bugfix: ratings and star count not exported in WooCommerce Review exports</li>\r\n 	<li>bugfix: simple XML exports generate invalid XML when there are no records by missing the closing tag</li>\r\n 	<li>bugfix: values that contain square brackets not exported in Google Merchants Exports</li>\r\n 	<li>bugfix: custom functions not correctly parsed in Google Merchants Exports</li>\r\n 	<li>bugfix: ACF repeater fields are exported using commas as a delimiter, but the bundle defaults to pipes when importing</li>\r\n</ul>\r\n<h4>1.6.4</h4>\r\n<ul>\r\n 	<li>improvement - remove Friendly Name editing option from Client Mode</li>\r\n 	<li>bugfix - array_intersect_key error when PMXE_Options are corrupt</li>\r\n 	<li>bugfix - order item fields with HTML encoded names can\'t be exported</li>\r\n</ul>\r\n<h4>1.6.3</h4>\r\n<ul>\r\n 	<li>New Feature: Allow non-admins to run exports with Client Mode</li>\r\n 	<li>bug fix: incorrect number of processed entries when exporting items only once in multiple iterations</li>\r\n 	<li>bug fix: Google Merchant Center throws error on shipping length</li>\r\n 	<li>bug fix: state not saved for \'Fill in empty columns\' and \'Display each repeater row in its own csv line\' in ACF repeater fields</li>\r\n 	<li>bug fix: js error when removing filters</li>\r\n 	<li>bug fix: use wp_salt() when AUTH_SALT isn\'t defined</li>\r\n 	<li>bug fix: downloadable files aren\'t migrated properly in some cases</li>\r\n 	<li>bug fix: \'0\' is present in the \'Export the value returned by a PHP function\' setting for Attachment fields</li>\r\n 	<li>bug fix: import template in bundle file not set to choose \'WooCommerce Reviews\' when imported</li>\r\n 	<li>bug fix: featured and attached images options not working for image fields</li>\r\n</ul>\r\n<h4>1.6.2</h4>\r\n<ul>\r\n 	<li>bugfix: some checkbox options broken after WordPress v5.5 compatibility fix</li>\r\n</ul>\r\n<h4>1.6.1</h4>\r\n<ul>\r\n 	<li>maintenance: compatibility with WordPress v5.5 jQuery changes</li>\r\n</ul>\r\n<h4>1.6.0</h4>\r\n<ul>\r\n 	<li>improvement: Export WooCommerce Reviews</li>\r\n 	<li>improvement: Migrate Comments and WooCommerce Reviews</li>\r\n 	<li>improvement: Export Cost of Goods Sold to Google Merchant Center</li>\r\n 	<li>improvement: Add WP_Query support for Toolset Types exports</li>\r\n 	<li>bug fix: time not exported in fields with date and time</li>\r\n 	<li>bug fix: date filters with ‘equal or older than’ doesn\'t include dates equal to the filter value</li>\r\n 	<li>bug fix: no default value for "Set to false if product has no GTIN or MPN"</li>\r\n 	<li>bug fix: PHP 7.3 warnings when exporting Excel files</li>\r\n</ul>\r\n<h4>1.5.11</h4>\r\n<ul>\r\n 	<li>improvement: export custom ACF fields defined in Gutenberg blocks</li>\r\n 	<li>improvement: disable scheduled exports via Automatic Scheduling UI</li>\r\n 	<li>API: add new filter wp_all_export_no_cache to avoid server cache for export files</li>\r\n 	<li>bug fix: WPAE UI is translated to the filtered WPML language</li>\r\n 	<li>bug fix: custom functions unavailable when editing an exported field</li>\r\n 	<li>bug fix: unable to update filters on the Run Export page</li>\r\n 	<li>bug fix: date filters including first/last day of month do not work properly</li>\r\n 	<li>bug fix: notices related to Google Merchants exports</li>\r\n 	<li>bug fix: exports sent to Zapier in the incorrect order</li>\r\n 	<li>bug fix: WooCommerce customer exports do not correctly report the number of exported customers</li>\r\n 	<li>bug fix: unable to only export customers once via scheduled exports</li>\r\n 	<li>bug fix: fields containing commas incorrectly exported to Google Merchant Center</li>\r\n 	<li>bug fix: product names are incorrectly urlencoded in custom XML exports</li>\r\n 	<li>bug fix: taxonomy meta fields not available for export</li>\r\n 	<li>bug fix: 0 values are represented as an empty string in custom XML exports</li>\r\n 	<li>bug fix: order items doubled in custom export fields in custom XML exports</li>\r\n 	<li>bug fix: custom fields not parsed correctly in custom XML exports</li>\r\n 	<li>bug fix: Manual Scheduling disabled when Automatic Scheduling is selected</li>\r\n 	<li>bug fix: unable to filtering by hours or minutes in some cases</li>\r\n 	<li>bug fix: unable to export ACF group fields</li>\r\n 	<li>bug fix: trying to delete History File fails ungracefully if it doesn\'t exist</li>\r\n 	<li>bug fix: Fee Amount exporting as an empty field in custom XML exports</li>\r\n</ul>\r\n<h4>1.5.10</h4>\r\n<ul>\r\n 	<li>improvement: add SAR currency to Google Merchant Center</li>\r\n 	<li>improvement: add default Unit Pricing Measure to Google Merchant Center</li>\r\n 	<li>improvement: only update max_execution_time on plugin requests, don\'t modify it globally</li>\r\n 	<li>bugfix: unable to export WooCommerce customers to XML</li>\r\n 	<li>bugfix: error with empty strings at the beginning or end of function calls</li>\r\n 	<li>bugfix: ACF date field not parsed correctly with some custom date formats</li>\r\n 	<li>bugfix: unable to export image galleries inside ACF flexible content fields to XML</li>\r\n 	<li>bugfix: time-based export filters should use GMT not server time</li>\r\n</ul>\r\n<h4>1.5.9</h4>\r\n<ul>\r\n 	<li>bug fix: unable to export users</li>\r\n</ul>\r\n<h4>1.5.8</h4>\r\n<ul>\r\n 	<li>improvement: add UAH currency to Google Merchant Center exports</li>\r\n 	<li>API: add \'pmxe_is_bundle\' filter</li>\r\n 	<li>bug fix: unable to filter by user data</li>\r\n 	<li>bug fix: wp_query missing error in some cases</li>\r\n 	<li>bug fix: ACF link export incorrectly formatted</li>\r\n 	<li>bug fix: "Tax Amount" rounded to nearest integer</li>\r\n 	<li>bug fix: currency included in price field when price is empty for Google Merchant Center exports</li>\r\n</ul>\r\n<h4>1.5.7</h4>\r\n<ul>\r\n 	<li>improvement: add Thai Baht to Google Merchant Center currencies</li>\r\n 	<li>improvement: add custom line endings for CSV</li>\r\n 	<li>API: add new action pmxe_acf_date_picker_format to set custom ACF date formats</li>\r\n 	<li>bugfix: unable to use wp-cron for scheduled exports on sites running PHP-FPM and WordPress 5.1+</li>\r\n 	<li>switched to wp-load for cron URLs, with backwards compatibility for wp-cron</li>\r\n 	<li>bugfix: ACF repeaters export incorrect values in ACF version 5.7.10+</li>\r\n 	<li>bugfix: Google Merchant Center incorrectly converts units from inches to mm</li>\r\n 	<li>bugfix: ACF date format not parsed correctly</li>\r\n 	<li>bugfix: tax amount incorrectly calculated in PHP 7.1+</li>\r\n 	<li>bugfix: is_empty field only looks for NULL fields, not empty values</li>\r\n 	<li>bugfix: exporting ACF user fields results in error</li>\r\n</ul>\r\n<h4>1.5.6</h4>\r\n<ul>\r\n 	<li>add-on: move all user export functionality to new user export add-on</li>\r\n 	<li>improvement: preserve admin body classes that are added by other plugins</li>\r\n 	<li>improvement: change scheduling endpoints from wp-cron.php to wp-load.php for WordPress 5.1/PHP-FPM compatibility</li>\r\n 	<li>bugfix: change language code alias for WPML compatibility</li>\r\n 	<li>bugfix: meta keys that are not returned as an array are exported as empty</li>\r\n 	<li>bugfix: allow uppercase ID in custom XML template</li>\r\n 	<li>bugfix: use ACF date format for date pickers</li>\r\n 	<li>bugfix: custom export field notices not working for WooCommerce orders</li>\r\n 	<li>bugfix: missing items in combine multiple fields are not replaced</li>\r\n 	<li>bugfix: term ID missing when using custom fields and exporting taxonomies</li>\r\n 	<li>bugfix: some WooCommerce attributes cause errors when writing to CSV</li>\r\n 	<li>bugfix: scheduling API responses improperly translated</li>\r\n 	<li>bugfix: changes to field not rendered in preview from edit field modal</li>\r\n</ul>\r\n<h4>1.5.5</h4>\r\n<ul>\r\n 	<li>bug fix: compatibility with ACF v5.7.11</li>\r\n</ul>\r\n<h4>1.5.4</h4>\r\n<ul>\r\n 	<li>improvement: add RTL support for Excel</li>\r\n 	<li>improvement: add Indonesian Rupiah to Google Merchant Center</li>\r\n 	<li>improvement: add Google Merchant Center field name as global variable to be used in custom functions</li>\r\n 	<li>bugfix: improve support for quotes in custom xml</li>\r\n 	<li>bugfix: increase number of rendered categories for Google Merchant Center</li>\r\n 	<li>bugfix: Google Merchant Center dimensions</li>\r\n 	<li>bugfix: include variations when filtering by categories</li>\r\n 	<li>bugfix: combine error messages when exporting refunds</li>\r\n 	<li>bugfix: refund ID snippet not being replaced when field is missing</li>\r\n 	<li>bugfix: fix filtering error when exporting comments</li>\r\n 	<li>bugfix: support exports scheduled at 12am and 12pm</li>\r\n 	<li>bugfix: fix filtering products with titles that contain slashes</li>\r\n 	<li>bugfix: merge headers for empty columns at end of file</li>\r\n 	<li>bugfix: fix filtering UI for long titles</li>\r\n 	<li>bugfix: allow exporting ACF checkbox fields</li>\r\n 	<li>bugfix: pmxe_woo_field parameters incorrect</li>\r\n 	<li>bugfix: downloadable files in custom XML not exporting</li>\r\n 	<li>bugfix: close incorrect tags when exporting ACF</li>\r\n 	<li>bugfix: export serialized values in combined fields</li>\r\n 	<li>bugfix: custom functions in Google Merchant Center price elements not triggering</li>\r\n 	<li>bugfix: get_site_url in multisite when using Google Merchant Center</li>\r\n 	<li>bugfix: allow users to be filtered by name</li>\r\n 	<li>bugfix: fix custom export fields in simple XML exports</li>\r\n 	<li>bugfix: fix tax rate code exports in custom export fields</li>\r\n</ul>\r\n<h4>1.5.3</h4>\r\n<ul>\r\n 	<li>improvement: improve function parsing in custom export fields</li>\r\n 	<li>improvement: Google Merchant Center titles are limited to 150 characters</li>\r\n 	<li>improvement: increase custom query meta limit</li>\r\n 	<li>new filter: added pmxe_after_iteration action</li>\r\n 	<li>bugfix: remove deprecated function calls for PHP 7.2 compatibility</li>\r\n 	<li>bugfix: address various PHP warnings and notices</li>\r\n 	<li>bugfix: filters for WooCommerce product variations</li>\r\n 	<li>bugfix: graceful failure for non:writable uploads folder</li>\r\n 	<li>bugfix: add warning when exporting WooCommerce orders using Automatic Scheduling</li>\r\n 	<li>bugfix: WooCommerce product variations exported as separate products when adding product attributes to custom export fields</li>\r\n 	<li>bugfix: function editor not rendered until clicked</li>\r\n 	<li>bugfix: small UI and spacing issues</li>\r\n 	<li>bugfix: WooCommerce products don\'t on their own row in order exports when using custom export fields</li>\r\n 	<li>bugfix: prices with more than two decimal places are not exported correctly</li>\r\n 	<li>bugfix: \'Only export orders that have been modified since last export\' doesn\'t work when filtering orders</li>\r\n 	<li>bugfix: exporting empty ACF values shifts rows in CSV exports</li>\r\n 	<li>bugfix: Australia missing from scheduling timezones</li>\r\n 	<li>bugfix: exporting meta in WooCommerce orders</li>\r\n 	<li>bugfix: unable to filter or export WooCommerce product visibility data</li>\r\n 	<li>bugfix: cannot export product type for variable products to Google Merchant Center</li>\r\n 	<li>bugfix: Google Merchant Center exports cannot automatically map sub-categories</li>\r\n</ul>\r\n<h4>1.5.2</h4>\r\n<ul>\r\n 	<li>improvement: Support migrating users &amp; keeping passwords</li>\r\n 	<li>improvement: Add Featured Image to Available Data › Media</li>\r\n 	<li>new filter: wp_all_export_raw_prices - disables price formatting</li>\r\n 	<li>bugfix: Error thrown when uploads folder is not writable</li>\r\n 	<li>bugfix: Preview is broken for date fields</li>\r\n 	<li>bugfix: Product visibility broken for old WooCommerce versions</li>\r\n 	<li>bugfix: Custom Export Field values not saved in some cases</li>\r\n 	<li>bugfix: Headers not matching content when they contain special characters</li>\r\n 	<li>bugfix: Headers not matching content when exporting certain ACF fields</li>\r\n 	<li>bugfix: Loading order for styles optimized to reduce conflicts</li>\r\n 	<li>bugfix: Import templates broken for WooCommerce product attributes</li>\r\n 	<li>bugfix: \'Export Images from Post Content\' option doesn\'t displaying in some cases</li>\r\n 	<li>bugfix: JSON parameters can now be passed through functions in Google Merchant Center exports</li>\r\n 	<li>bugfix: WP Query exports broken for users and comments</li>\r\n 	<li>bugfix: Meta missing when migrating unattached images</li>\r\n 	<li>bugfix: Available Data broken when there\'s more than 500 data elements</li>\r\n 	<li>bugfix: Custom Export Fields are unstable when many are added to the same export</li>\r\n</ul>\r\n<h4>1.5.1</h4>\r\n<ul>\r\n 	<li>bug fix: custom fields are exported as their name</li>\r\n</ul>\r\n<h4>1.5.0</h4>\r\n<ul>\r\n 	<li>new feature: Automatic Scheduling</li>\r\n 	<li>new feature: Custom export fields</li>\r\n 	<li>improvement: licenses hidden in the ui and encoded in the database</li>\r\n 	<li>improvement: improved error reporting for custom functions errors</li>\r\n 	<li>improvement: changed excerpt to short description</li>\r\n 	<li>improvement: better price formatting</li>\r\n 	<li>improvement: better function parsing in Google Merchant Center exports</li>\r\n 	<li>improvement: exclude parent products from Google Merchant Center exports</li>\r\n 	<li>improvement: added CHF to list of supported Google Merchant Center currencies</li>\r\n 	<li>improvement: added support for acf clone field</li>\r\n 	<li>improvement: added security token to cron URLs for improved security</li>\r\n 	<li>improvement: added author information to Available Data</li>\r\n 	<li>improvement: added wp_all_export_order_item filter</li>\r\n 	<li>improvement: added wp_all_export_use_csv_compliant_line_endings filter</li>\r\n 	<li>improvement: added wp_all_export_pre_csv_headers filter</li>\r\n 	<li>improvement: added wp_all_export_repeater_delimiter filter</li>\r\n 	<li>bugfix: PHP notices and warnings</li>\r\n 	<li>bugfix: error when activating Pro version and Free version</li>\r\n 	<li>bugfix: splitting custom XML export files</li>\r\n 	<li>bugfix: removed moment.js which was causing false virus positives in some browsers</li>\r\n 	<li>bugfix: Google Merchant Center category mapping</li>\r\n 	<li>bugfix: do not update comment status by default</li>\r\n 	<li>bugfix: "only export modified posts" when using cron</li>\r\n 	<li>bugfix: file name filters when using crons</li>\r\n 	<li>bugfix: shortcodes in custom XML snippets</li>\r\n 	<li>bugfix: ACF flexible fields</li>\r\n 	<li>bugfix: problems when running Google Merchant Center exports via cron</li>\r\n 	<li>bugfix: CSV writer fixes to take into account https://bugs.php.net/bug.php?id=43225</li>\r\n 	<li>bugfix: exporting ACF and custom fields with HTML tags</li>\r\n 	<li>bugfix: stray root tags in WooCommerce Order exports</li>\r\n 	<li>bugfix: timeouts when connecting Jetpack to WordPress.com</li>\r\n 	<li>bugfix: exporting product images in Google Merchant Center</li>\r\n 	<li>bugfix: corrupted Excel files</li>\r\n 	<li>bugfix: conflicts with some plugins changing the post order</li>\r\n 	<li>bugfix: comment handling in custom XML</li>\r\n 	<li>bugfix: blank CodeMirror in dialogs</li>\r\n 	<li>bugfix: parsing CDATA tags that contain HTML tags</li>\r\n 	<li>bugfix: Google Merchant Center handling quotes in functions</li>\r\n 	<li>bugfix: improved Google Merchant Center snippet parser</li>\r\n 	<li>bugfix: CSV headers when field names contained quotes</li>\r\n 	<li>bugfix: included WPML query in variation query</li>\r\n 	<li>bugfix: handling of the "visibility" field based on WooCommerce version</li>\r\n</ul>\r\n<h4>1.4.7</h4>\r\n<ul>\r\n 	<li>improvement: Improved accuracy for export timer</li>\r\n 	<li>improvement: Removed moment.js dependency which causes false positives in some antivirus software</li>\r\n 	<li>imporovement New export complete page</li>\r\n 	<li>bugfix: Fixed problems when switching from WPAE free to WPAE pro</li>\r\n 	<li>bugfix: Special characters in product attributes support</li>\r\n 	<li>bugfix: Fix category mapper containing special characters</li>\r\n 	<li>bugfix: Fixed parsing content with shortcodes in custom XML Export</li>\r\n 	<li>bugfix: Fixed exporting ACF fields with no value for some posts</li>\r\n</ul>\r\n<h4>1.4.6</h4>\r\n<ul>\r\n 	<li>improvement: removed autoload=true from wp_options</li>\r\n 	<li>improvement: use \'Export product variations and their parent products\' by default</li>\r\n 	<li>improvement: WPML options in separate section</li>\r\n 	<li>improvement: category mapper optimization</li>\r\n 	<li>improvement: memory usage to avoid memory limit errors</li>\r\n 	<li>bug fix: allow underscores in main xml tags</li>\r\n 	<li>bug fix: prevent uploading import template into wpae</li>\r\n 	<li>bug fix: ID column in CSV</li>\r\n 	<li>bug fix: date equals or older filter</li>\r\n 	<li>bug fix: ACF repeater headers</li>\r\n 	<li>bug fix: size type mapper and no categories message</li>\r\n 	<li>bug fix: export ID in custom XML mode</li>\r\n 	<li>bug fix: date filtering</li>\r\n 	<li>bug fix: export product variation status</li>\r\n 	<li>bug fix: the "Shipping Class" field in Google Merchants export.</li>\r\n</ul>\r\n<h4>1.4.5</h4>\r\n<ul>\r\n 	<li>improvement: added new option \'Only export Pages that have been modified since last export\'</li>\r\n 	<li>improvement: added post_modified field</li>\r\n 	<li>improvement: handling functions in google meerchants fields</li>\r\n 	<li>bug fix: snippets parsing in Custom XML Export</li>\r\n 	<li>bug fix: template saving. Fixed product image export to Google Merchants</li>\r\n 	<li>bug fix: export attributes for simple products</li>\r\n 	<li>bug fix: db schema updating</li>\r\n 	<li>bug fix: variations with trashed parents shouldn\'t be included in the export</li>\r\n 	<li>bug fix: google Merchants inconsistent category search</li>\r\n 	<li>bug fix: minified JS to avoid problems for CloudFlare users</li>\r\n</ul>\r\n<h4>1.4.4</h4>\r\n<ul>\r\n 	<li>improvement: export to Google Merchant Center</li>\r\n 	<li>improvement: choose WPML language in export options</li>\r\n 	<li>improvement: filter WooCommerce Orders by order item data</li>\r\n 	<li>improvement: export CSV without header row</li>\r\n 	<li>bug fix: export ACF message field</li>\r\n 	<li>bug fix: export product categories with AFC repeater fields</li>\r\n 	<li>bug fix: export duplicate images from gallery</li>\r\n 	<li>bug fix: filter products by custom fields</li>\r\n 	<li>bug fix: export search</li>\r\n 	<li>bug fix: export product variation attribute names</li>\r\n 	<li>bug fix: processing serialized data in custom snippets</li>\r\n 	<li>bug fix: export more than one coupon_used field</li>\r\n 	<li>bug fix: migrating hierarchical posts and pages</li>\r\n</ul>\r\n<h4>1.4.3</h4>\r\n<ul>\r\n 	<li>improvement: compatibility with PHP 7.x</li>\r\n 	<li>improvement: new export field \'Order Item ID\'</li>\r\n 	<li>improvement: possibility for filter order by order items data</li>\r\n 	<li>improvement: new option \'Include header row and column titles in export\'</li>\r\n 	<li>bug fix: processing serialized data in custom snippets</li>\r\n 	<li>bug fix: export ACF repeater field in custom XML mode</li>\r\n 	<li>bug fix: applying php function to product attributes</li>\r\n 	<li>bug fix: export coupon_used field</li>\r\n</ul>\r\n<h4>1.4.2</h4>\r\n<ul>\r\n 	<li>new feature: added export taxonomies feature</li>\r\n 	<li>improvement: new export variable products options</li>\r\n 	<li>improvement: added possibility to export to xlsx</li>\r\n 	<li>improvement: added ACF fields to \'migrate\' &amp; \'add all fields\' features</li>\r\n 	<li>improvement: added new filter \'wp_all_export_field_name\'</li>\r\n 	<li>improvement: changed default date export to Y/m/d</li>\r\n 	<li>bug fix: export shipping class for product variations</li>\r\n 	<li>bug fix: import template for ACF relationship fields</li>\r\n 	<li>bug fix: export ACF fields in custom XML mode</li>\r\n 	<li>bug fix: export empty images metadata</li>\r\n 	<li>bug fix: import template for ACF gallery</li>\r\n 	<li>bug fix: import template for variation_description</li>\r\n 	<li>bug fix: import template for default product attributes</li>\r\n 	<li>bug fix: fields ordering for custom XML export</li>\r\n 	<li>bug fix: menu order migration</li>\r\n 	<li>bug fix: automatically adding parent_id column on products export</li>\r\n 	<li>bug fix: SQL query ( caused timeout error )</li>\r\n 	<li>bug fix: parsing snippets in attributes in elements</li>\r\n</ul>\r\n<h4>1.4.1</h4>\r\n<ul>\r\n 	<li>bug fix: compatibility with PHP 5.3</li>\r\n</ul>\r\n<h4>1.4.0</h4>\r\n<ul>\r\n 	<li>new feature: export custom xml template</li>\r\n 	<li>improvement: new filter wp_all_export_after_csv_line</li>\r\n 	<li>improvement: date options for sale price dates from/to</li>\r\n 	<li>improvement: ability to use tab as csv delimiter</li>\r\n 	<li>improvement: new filter \'wp_all_export_csv_headers\'</li>\r\n 	<li>improvement: pull the parent taxonomy data when exporting variations</li>\r\n 	<li>improvement: remove spaces from export filename</li>\r\n 	<li>bug fix: \'posts_clauses\' filter issue</li>\r\n 	<li>bug fix: db schema on multisite</li>\r\n 	<li>bug fix: export order items date</li>\r\n 	<li>bug fix: import template for media items</li>\r\n 	<li>bug fix: \'Only export Products once\' for new exports</li>\r\n 	<li>bug fix: export ACF repeater in XML format</li>\r\n 	<li>bug fix: order_completed_date filter</li>\r\n 	<li>bug fix: export in CSV format when \'Main XML Tag\' &amp; \'Record XML Tag\' option are blank</li>\r\n 	<li>bug fix: export order items taxonomies</li>\r\n 	<li>bug fix: export ACF date_time_picker</li>\r\n 	<li>bug fix: date filter by time</li>\r\n 	<li>bug fix: is empty filters</li>\r\n 	<li>bug fix: nested filter rules</li>\r\n</ul>\r\n<h4>1.3.2</h4>\r\n<ul>\r\n 	<li>fixed \'Only export Posts once\' for new exports</li>\r\n 	<li>fixed db schema for multisite</li>\r\n 	<li>fixed export order items date</li>\r\n 	<li>fixed media items export ordering</li>\r\n 	<li>fixed import template for media items</li>\r\n 	<li>fixed export ACF repeater in XML format</li>\r\n 	<li>fixed order_completed_date filter</li>\r\n 	<li>added new filter \'wp_all_export_csv_headers\'</li>\r\n 	<li>added possibility to use tab as csv delimiter "t"</li>\r\n 	<li>updated french translation</li>\r\n</ul>\r\n<h4>1.3.1</h4>\r\n<ul>\r\n 	<li>added WooCommerce order migration</li>\r\n 	<li>added _thumbnail_id to the filtering dropdown</li>\r\n 	<li>added new filter \'wp_all_export_is_wrap_value_into_cdata\'</li>\r\n 	<li>added new filters \'wp_all_export_add_before_element\', \'wp_all_export_add_after_element\'</li>\r\n 	<li>added \'WPML Translation ID\' element to available data</li>\r\n 	<li>modified preview to show first 10 records</li>\r\n 	<li>fixed csv export with non comma delimiter</li>\r\n 	<li>fixed conflict with WP Google Maps Pro plugin</li>\r\n 	<li>fixed downloading XLS export file when security mode is disabled</li>\r\n</ul>\r\n<h4>1.3.0</h4>\r\n<ul>\r\n 	<li>fixed misaligned columns on exporting product attributes</li>\r\n 	<li>fixed export nested repeaters field in CSV format</li>\r\n 	<li>fixed conflict between enabled ‘Only export Products once’ &amp; filtering rules</li>\r\n 	<li>fixed live records counting for advanced export mode</li>\r\n 	<li>fixed Events Calendar conflict</li>\r\n 	<li>added Google Merchants support</li>\r\n 	<li>added new filters \'wp_all_export_add_before_node\', \'wp_all_export_add_after_node\'</li>\r\n 	<li>added possibility to filter posts by author data</li>\r\n 	<li>added XLS support, redesign CSV/XML options in Step 2</li>\r\n 	<li>added feature to use php function in filtering rules</li>\r\n 	<li>added possibility export repeater rows one per line</li>\r\n 	<li>added backward compatibility for export comments on WordPress less than 4.2.0</li>\r\n 	<li>exclude orphaned variations from exprt file</li>\r\n 	<li>changed UI for export media data ( images &amp; attachments )</li>\r\n</ul>\r\n<h4>1.2.3</h4>\r\n<ul>\r\n 	<li>fixed export attachment meta alt</li>\r\n 	<li>fixed export manually stored ACF</li>\r\n 	<li>fixed export repeater field for users in csv format</li>\r\n 	<li>fixed saving special chars in function editor</li>\r\n 	<li>fixed import export templates</li>\r\n 	<li>fixed error on activate WPAE license</li>\r\n 	<li>fixed ajaxurl conflict with WPML</li>\r\n 	<li>fixed filtering by ACF taxonomy field</li>\r\n 	<li>create a stable copy of exported file for remote access during export process</li>\r\n 	<li>added French &amp; Latvian translations</li>\r\n 	<li>added \'Variation Description\' field</li>\r\n</ul>\r\n<h4>1.2.2</h4>\r\n<ul>\r\n 	<li>fixed \'wp_all_export_additional_data\' filter on cron job</li>\r\n 	<li>fixed Zapier intergation</li>\r\n 	<li>fixed import template for variable products</li>\r\n 	<li>fixed css for WordPress 4.4</li>\r\n 	<li>fixed export ACF repeater field</li>\r\n</ul>\r\n<h4>1.2.1</h4>\r\n<ul>\r\n 	<li>added export comments</li>\r\n 	<li>added possibility to add NS to field names</li>\r\n 	<li>fixed export repeater field ACF 4.x</li>\r\n 	<li>fixed cron export, was exported wrong data amount when there are sticky posts in database</li>\r\n 	<li>fixed updating filter rules on cron job</li>\r\n 	<li>fixed error on edit custom column name for Woo Orders</li>\r\n</ul>\r\n<h4>1.2.0</h4>\r\n<ul>\r\n 	<li>fixed manage exports screen: "Info and options" disappears when WPAI plugin is disabled</li>\r\n 	<li>fixed WP_Query results ordering</li>\r\n 	<li>fixed export ACF repeater field for CSV</li>\r\n 	<li>fixed export filtering</li>\r\n 	<li>added es_ES translation</li>\r\n 	<li>added possibility to change export field name ( related to export WooCommerce Orders )</li>\r\n 	<li>added option \'Split large exports into multiple files\'</li>\r\n 	<li>added option \'Only export posts once\'</li>\r\n 	<li>added option \'Create a new export file each time export is run\'</li>\r\n 	<li>added option \'Fill in empty columns\': If enabled, each order item will appear as its own row with all order info filled in for every column. If disabled, order info will only display on one row with only the order item info displaying in additional rows</li>\r\n 	<li>added ‘pmxe_exported_post’ action: do_action(\'pmxe_exported_post\', $record-&gt;ID );</li>\r\n 	<li>added Zapier support ( beta )</li>\r\n 	<li>added possibility to control main xml tag names &amp; put additional info into xml file: apply_filters(\'wp_all_export_additional_data\', array(), $exportOptions)</li>\r\n 	<li>added export templates</li>\r\n 	<li>added hidden post types to the dropdown list on step 1</li>\r\n 	<li>replaced \'export key\' to \'export hash\' in \'Export File URL\' on scheduling page</li>\r\n 	<li>updated re-run export screen</li>\r\n</ul>\r\n<h4>1.1.1</h4>\r\n<ul>\r\n 	<li>fixed download bundle</li>\r\n 	<li>fixed export repeater fields for ACF 4.x</li>\r\n 	<li>fixed import template for custom product attributes</li>\r\n 	<li>fixed cron job responses, now theay are in JSON format</li>\r\n 	<li>added bundle URL to scheduling page</li>\r\n 	<li>added new option \'include BOM to export file</li>\r\n 	<li>added RU translation</li>\r\n 	<li>added function editor</li>\r\n 	<li>removed hidden post types from dropdown in step 1</li>\r\n</ul>\r\n<h4>1.1.0</h4>\r\n<ul>\r\n 	<li>fixed export taxonomy: name instead of slug</li>\r\n 	<li>fixed export filtering (query with multiple meta keys)</li>\r\n 	<li>fixed display products in own row option</li>\r\n 	<li>fixed pass data through php function</li>\r\n 	<li>added advanced (custom fields) section to export woo orders</li>\r\n 	<li>added draggable element deletion</li>\r\n 	<li>added auto-generate product export fields</li>\r\n 	<li>added \'attributes\' field to product data</li>\r\n 	<li>added feedback page</li>\r\n 	<li>added another \'Auto Generate\' button for products export</li>\r\n 	<li>added button to download bundle for WP All Import</li>\r\n 	<li>updated export file name</li>\r\n 	<li>changed export files destination to /exports</li>\r\n</ul>\r\n<h4>1.0.2</h4>\r\n<ul>\r\n 	<li>Added export users</li>\r\n 	<li>Added scheduled exports</li>\r\n 	<li>Added orders export</li>\r\n 	<li>Added filtering options</li>\r\n</ul>\r\n<h4>1.0.1</h4>\r\n<ul>\r\n 	<li>updated icons</li>\r\n 	<li>fixed taxonomies export</li>\r\n</ul>\r\n<h4>1.0.0</h4>\r\n<ul>\r\n 	<li>Initial release</li>\r\n</ul>";}s:7:"banners";a:2:{s:4:"high";s:56:"https://ps.w.org/wp-all-export/assets/banner-772x250.png";s:3:"low";s:0:"";}s:18:"custom_update_note";s:0:"";s:19:"update_note_version";s:0:"";s:5:"icons";a:0:{}s:3:"msg";s:33:"No license key has been provided.";s:6:"tested";s:5:"6.5.4";s:6:"author";s:6:"Soflyy";s:8:"requires";s:3:"5.0";s:12:"requires_php";s:3:"7.4";s:12:"contributors";a:2:{s:6:"soflyy";a:3:{s:12:"display_name";s:6:"soflyy";s:7:"profile";s:37:"https://profiles.wordpress.org/soflyy";s:6:"avatar";s:51:"https://wordpress.org/grav-redirect.php?user=soflyy";}s:11:"wpallimport";a:3:{s:12:"display_name";s:11:"wpallimport";s:7:"profile";s:42:"https://profiles.wordpress.org/wpallimport";s:6:"avatar";s:56:"https://wordpress.org/grav-redirect.php?user=wpallimport";}}}', 'no'),
