n<!-- wp:woocommerce/checkout-order-summary-taxes-block -->\n<div class="wp-block-woocommerce-checkout-order-summary-taxes-block"></div>\n<!-- /wp:woocommerce/checkout-order-summary-taxes-block --></div>\n<!-- /wp:woocommerce/checkout-order-summary-block --></div>\n<!-- /wp:woocommerce/checkout-totals-block --></div>\n<!-- /wp:woocommerce/checkout -->', 'Finalizar la compra', '', 'publish', 'closed', 'closed', '', 'finalizar-comprar', '', '', '2024-06-09 23:23:47', '2024-06-10 02:23:47', '', 0, 'http://local.finaco.com/finalizar-comprar/', 0, 'page', '', 0),
