	(41, 'woopay-beta-merchantrecruitment-short-update-09MAY23', 'info', 'en_US', 'Increase conversions with WooPay — our fastest checkout yet', 'Be one of the first to try WooPay, our new express checkout feature. <br>Boost conversions by letting customers pay with a single click. <br><br>Update to the latest version of WooCommerce Payments to get started.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(42, 'woocommerce-WCSubscriptions-June-2023-updated-needed', 'marketing', 'en_US', 'Action required: Security update of WooCommerce Subscriptions', '<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(43, 'woocommerce-WCReturnsWarranty-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Returns and Warranty Requests extension', '<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(44, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(45, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(46, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(47, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(48, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(49, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(50, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(51, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(52, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(53, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href="https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(54, 'woocommerce-STRIPE-Oct-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe Gateway', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(55, 'amazon-mcf-reviews-2023-12-07', 'marketing', 'en_US', 'Enjoying Amazon MCF for WooCommerce?', 'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(56, 'remove_estimated_deposits_2024', 'marketing', 'en_US', 'Estimated deposits are going away', 'To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(57, 'woocommerce-payfast-may-2024-update-needed', 'update', 'en_US', 'An important update is required for the Payfast Payment Gateway', '<strong>Please update to the latest version of the Payfast Payment Gateway for WooCommerce immediately to address a security vulnerability</strong>. This update is required to ensure that your transactions continue to process.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(58, 'mailchimp_q2_2024', 'marketing', 'en_US', 'Level up your marketing to boost sales', 'Looking for a smart way to kickstart your growth? Mailchimp’s best-in-class email marketing empowers you to create and automate precisely targeted SMS and email campaigns and build long-term relationships with your audience. Enhance your customer experience, track sales, and more by connecting your store to Mailchimp.', '{}', 'pending', 'woocommerce.com', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(59, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Conectar con WooCommerce.com', 'Conectate para recibir avisos y actualizaciones de productos importantes.', '{}', 'unactioned', 'woocommerce-admin', '2024-06-10 02:23:52', NULL, 0, 'plain', '', 0, 0, 'info'),
	(60, 'wc-admin-orders-milestone', 'info', 'en_US', 'Primer pedido recibido', '¡Felicitaciones por conseguir tu primer pedido! Es un buen momento para aprender a gestionar tus pedidos.', '{"current_milestone":1}', 'unactioned', 'woocommerce-admin', '2024-06-10 13:04:43', NULL, 0, 'plain', '', 0, 0, 'info'),
	(61, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', '¿Estás eligiendo un tema?', 'Dale un vistazo a los temas compatibles con WooCommerce, y elegí uno alineado con tu marca y las necesidades de tu negocio.', '{}', 'unactioned', 'woocommerce-admin', '2024-06-11 16:08:34', NULL, 0, 'plain', '', 0, 0, 'info'),
	(62, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'Cómo personalizar tu catálogo de productos', 'Querés que tu catálogo de productos y tus imágenes tengan un aspecto estupendo y estén en consonancia con tu marca. Esta guía te dará todos los consejos que necesitás para que tus productos se vean bien en tu tienda.', '{}', 'unactioned', 'woocommerce-admin', '2024-06-11 16:08:34', NULL, 0, 'plain', '', 0, 0, 'info'),
	(63, 'wc-admin-launch-checklist', 'info', 'en_US', '¿Estás listo para poner tu tienda en funcionamiento?', 'Para asegurarnos de que nunca tengas esa sensación de ¿Qué se me olvidó?, preparamos una lista de comprobación esencial previa a la puesta en funcionamiento.', '{}', 'unactioned', 'woocommerce-admin', '2024-06-11 16:08:34', NULL, 0, 'plain', '', 0, 0, 'info'),
	(64, 'WC-order-attribution-update-June-2024', 'update', 'en_US', 'An important update is required for WooCommerce', '<strong>An important security update for WooCommerce has been released</strong>. It is recommended that you update as quickly as possible.', '{}', 'unactioned', 'woocommerce.com', '2024-06-11 16:08:36', NULL, 0, 'plain', '', 0, 0, 'info');
